import './App.css';

export default function App() {
  return (
      <body className={"h-screen bg-gradient-to-tr from-slate-900 to-cyan-900"}>
          <div className={"absolute bg-cyan-900 h-24 w-24 rounded-full right-10 top-20 blur-md"}></div>
          <div className={"border-b-2 border-gray-400 dark:bg-black"}>
              <div className="flex p-6 mx-auto bg-white dark:bg-slate-800/75 uppercase text-black dark:text-gray-200">
                  <a href={"/"} className={"hover:text-gray-500"}>home</a>
                  <div className={"right-0 space-x-5 mx-6 absolute"}>
                      <a className={"hover:text-gray-500"}>projects</a>
                      <a className={"hover:text-gray-500"}>about</a>
                      <a className={"hover:text-gray-500"}>contact</a>
                  </div>
              </div>
          </div>
      </body>
  );
}
